script: |
  super -f text -I q5610.spq | sort > q5610.out

inputs:
  - name: q5610.spq
    data: |
      SELECT - CAST ( - - 38 AS INTEGER ) + + col2 + - 4 FROM tab2 (FORMAT parquet) AS cor0 WHERE NULL NOT BETWEEN 55 * ( - col2 ) + + 14 AND NULL;
  - name: tab2

outputs:
  - name: q5610.out
    data: |
